import React, {useState} from 'react';
import cx from 'classnames';
import {ReactSVG} from 'react-svg';

import diagramIcon from '../../../assets/svg/leaderboard.svg';
import accountIcon from '../../../assets/svg/people.svg';
import settingsIcon from '../../../assets/svg/settings.svg';

const Organization = () => {
    const [activeMenuTab, setActiveMenuTab] = useState('Dashboard');
    const setActiveMenuHandler = (tabName) => {
        setActiveMenuTab(tabName);
    };
    return (
        <div className="organization-container">
            <div className="sidebar">
                <div className="organization-sidebar">
                    <div
                        role="presentation"
                        className="organization-sidebar__item"
                        onClick={() => setActiveMenuHandler('Dashboard')}
                    >
                        <ReactSVG
                            className={cx('svg', {
                                'svg-active': activeMenuTab === 'Dashboard',
                            })}
                            src={diagramIcon}
                        />{' '}
                        Dashboard
                    </div>
                    <div
                        role="presentation"
                        className="organization-sidebar__item"
                        onClick={() => setActiveMenuHandler('Accounts')}
                    >
                        <ReactSVG
                            className={cx('svg', {
                                'svg-active': activeMenuTab === 'Accounts',
                            })}
                            src={accountIcon}
                        />{' '}
                        Accounts
                    </div>
                    <div
                        role="presentation"
                        className="organization-sidebar__item"
                        onClick={() => setActiveMenuHandler('Settings')}
                    >
                        <ReactSVG
                            className={cx('svg', {
                                'svg-active': activeMenuTab === 'Settings',
                            })}
                            src={settingsIcon}
                        />{' '}
                        Settings
                    </div>
                </div>
            </div>
            <div className="content">
                <div className="organization-container__heading">Dashboard</div>
            </div>
            <div className="sidebar">
                <div className='diagram'/>
            </div>
        </div>
    );
};
export default Organization;
